import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div id="container">
      <div className="body">
        <header>
          <a href="#" className="logo"><img src="logo.png" alt="" /></a>
          div.
        </header>
      </div>
    </div>
  );
};

export default Home;
